import axios from "axios";
import React, {useState, useEffects} from "react";




export default function Table(props) {
  const [empoloyee, setEmployee] = useState(null);
  
  async function fetchEmployeeData(id) {
    const response = await fetch("https://randomuser.me/api/?results=50" + id);
    setUser(await response.json());
  }

  useEffect(() => {
    fetchEmployeeData(props.id);
  },[props.id]);
  if(!empoloyee) {
    return "loading...";
  }
}
